import { Navbar, Container } from 'react-bootstrap';

export default function NavbarApp(){
    return(
        <Navbar bg="primary" variant="dark">
            <Container>
                <Navbar.Brand href="/scan">Scan</Navbar.Brand>
                <Navbar.Brand href="/historique">Historiques</Navbar.Brand>
            </Container>
        </Navbar>
    )
}
